import React from "react";
import { Link } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";

const About = () => {
  return (
    <div className="about">
      <Container>
        <Row>
          <Col>
            <h1>ABOUT</h1>
            <p>This is the about</p>
            </Col>
        </Row>
      </Container>
    </div>
  );
}

export default About;
